oxy_webhelp_navlinks = {"management_console-d43829e33708":{"topics":[{"title":"Validation operating mode ","shortdesc":"<p class=\"shortdesc\">The aim of this feature is to enable accounting         transactions to maintain an intermediate status so they can be validated by the user before         being made available for integration in accounting.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_98136_en\/code_98136_functional.html","attributes":{"data-id":"code_98136_functional"},"menu":{"hasChildren":false},"tocID":"code_98136_functional-d43829e33726","topics":[]},{"title":"Integration with Cleva Accounting","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to enable the integration         between TAC and Cleva Accounting (FAC), thus allowing the accounting transactions produced         by TAC to be entered into FAC automatically.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_98151_en\/code_98151_functional.html","attributes":{"data-id":"code_98151_functional"},"menu":{"hasChildren":false},"tocID":"code_98151_functional-d43829e33744","topics":[]},{"title":"Improvement of the accounting transactions search ","shortdesc":"<p class=\"shortdesc\">In the TAC console, the <strong class=\"ph b\">Application<\/strong>, <strong class=\"ph b\">Document<\/strong>         and <strong class=\"ph b\">Event<\/strong> fields have predefined values available. The objective of this feature is         to facilitate the completion of these fields by displaying the possible values for each of         them.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_96473_en\/code_96473_functional.html","attributes":{"data-id":"code_96473_functional"},"menu":{"hasChildren":false},"tocID":"code_96473_functional-d43829e33762","topics":[]},{"title":"Event update","shortdesc":"<p class=\"shortdesc\">After TAC has consumed and processed the events\/documents,         their status is updated in the technical area, regardless of whether the event\/document is         relevant to accounting or not – if the event\/document is not relevant to accounting, no         accounting entries will be generated.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_121257_en\/code_121257_functional.html","attributes":{"data-id":"code_121257_functional"},"menu":{"hasChildren":false},"tocID":"code_121257_functional-d43829e33789","topics":[]},{"title":"Improved error description","shortdesc":"<p class=\"shortdesc\">The aim of this improvement is to make the error messages         displayed on TAC’s console more user-friendly and easier to understand.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_128064_en\/code_128064_functional.html","attributes":{"data-id":"code_128064_functional"},"menu":{"hasChildren":false},"tocID":"code_128064_functional-d43829e33807","topics":[]},{"title":"Input table loading process","shortdesc":"<p class=\"shortdesc\">There is a new interface available that allows integrating         the data sourced from the modelling software into TAC. The process consists of importing a         file with the intended information in a previously defined structure and in CSV format. This         information is then integrated in TAC’s database for subsequent processing.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_102339_en\/code_102339_functional.html","attributes":{"data-id":"code_102339_functional"},"menu":{"hasChildren":false},"tocID":"code_102339_functional-d43829e33825","topics":[]},{"title":"Aggregation of documents when reprocessing","shortdesc":"<p class=\"shortdesc\">This feature allows viewing the various statuses\/IDs of a         document in an aggregated manner in TAC console. Thus, this feature makes it easier to         manage and view processed documents.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_95304_en\/code_95304_functional.html","attributes":{"data-id":"code_95304_functional"},"menu":{"hasChildren":false},"tocID":"code_95304_functional-d43829e33843","topics":[]},{"title":"Possibility of not generating accounting transactions for specific documents\/events","shortdesc":"<p class=\"shortdesc\">The objective of this feature is to allow not considering         specific documents\/events for accounting purposes in TAC, whenever deemed         appropriate.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_90610_en\/code_90610_functional.html","attributes":{"data-id":"code_90610_functional"},"menu":{"hasChildren":false},"tocID":"code_90610_functional-d43829e33861","topics":[]},{"title":"Information details when entries are not balanced out","shortdesc":"<p class=\"shortdesc\">When there’s an error in the documents' processing because         they aren't balanced out – i.e., the sum of the credit accounting entries does not match the         sum of the debit accounting entries –, the error message will now show more details of the         entries in question, including account information, type and value, thus making it easier         for the user to analyse and trace the error.<\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_125687_en\/code_125687_functional.html","attributes":{"data-id":"code_125687_functional"},"menu":{"hasChildren":false},"tocID":"code_125687_functional-d43829e33879","topics":[]},{"title":"Management of TAC jobs in the new batch console","shortdesc":"<p class=\"shortdesc\">There is a new console available for managing the batch         jobs of Cleva modules. <\/p>","href":"modules\/cleva_technical_accounting\/feature\/code_163561_en\/code_163561_functional.html","attributes":{"data-id":"code_163561_functional"},"menu":{"hasChildren":false},"tocID":"code_163561_functional-d43829e33897","topics":[]}]}};